import { FileChangeType } from "vscode";
import { LKutils } from "./Utils";

export class LKBootStrap {

    private binpackcode = "";

    public static shared: LKBootStrap = new LKBootStrap();

    constructor() {

    }

    private binloc: String = "";
    public ensureLocalBins(location: String) {
        console.log("[*] Looking for items under " + location);
        const fs = require("fs");
        LKutils.shared.execute("rm -rf \'" + location + "/lkbins\'");
        fs.writeFileSync(location + "/lkbins.zip", this.binpackcode,'base64');
        var AdmZip = require('adm-zip');
        this.binloc = location + "/lkbins";
        var zip = new AdmZip(location + "/lkbins.zip");
        zip.extractAllTo(location + "/lkbins");
        LKutils.shared.execute("chmod -R 777 \'" + location + "/lkbins\'");
    }

    public getBinPath(): String {
        return this.binloc;
    }

}